  `article_bint` int(11) DEFAULT NULL COMMENT 'int备用',
  `article_up` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数',
  `article_comment` int(3) NOT NULL DEFAULT '0' COMMENT '评论数',
  PRIMARY KEY (`article_id`),
  KEY `article_type` (`article_type`),
